export const FilterFruit = (fruit) => {
    const sweetFruits = fruit.filter((fruits) => fruits.taste === 'sweet') //fruits.name.length <= 6
    return (
        <>
            <h1>Filtered Fruit</h1>
            {
                sweetFruits.map((fruit)=>{
                <p>{fruit.name}</p>
            })
            }
        </>

    )

}
